"     <li>",
"      Normastigmin (AT);",
"     </li>",
"     <li>",
"      Polstigminum (PL);",
"     </li>",
"     <li>",
"      Prostig (PH);",
"     </li>",
"     <li>",
"      Prostigmin (AE, AT, BB, BF, BH, BJ, BM, BS, BZ, CH, CI, CY, CZ, DE, EC, EG, ET, GH, GM, GN, GY, ID, IL, IQ, IR, JM, JO, KE, KW, LB, LR, LY, MA, ML, MR, MU, MW, NE, NG, NL, NO, OM, PK, PR, PY, QA, SA, SC, SD, SG, SL, SN, SR, SY, TH, TN, TT, TZ, UG, YE, ZA, ZM, ZW);",
