"     <a class=\"nounderline abstract\" href=\"UTD.htm?10/41/10904/abstract/1\">",
"      Russell JP, Gibson LE. Primary cutaneous small vessel vasculitis: approach to diagnosis and treatment. Int J Dermatol 2006; 45:3.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?10/41/10904/abstract/2\">",
"      Martinez-Taboada VM, Blanco R, Garcia-Fuentes M, Rodriguez-Valverde V. Clinical features and outcome of 95 patients with hypersensitivity vasculitis. Am J Med 1997; 102:186.",
"     </a>",
